  const _sfc_main = {
    data() {
      return {
        activeItem: "Pragmatic Play",
        hotimages: [
          'https://it-cgg.b-cdn.net/rtp/rajapanen/hot-games/so-hot.webp',
          'https://it-cgg.b-cdn.net/rtp/rajapanen/hot-games/hot-bigwin.webp'
        ],
        currentIndex: 0,
        intervalId: null,
        queryPragma: '',
